import React from "react";
import "./App.css";
import Header from "./components/Header";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <ul>
          <li className="header">
            <Link to="/">
              <span className="home">&#8962;</span>
            </Link>
          </li>
        </ul>
        <Route exact path="/" component={Header} />
      </div>
    </Router>
  );
}

export default App;
